import { useState, useEffect } from 'react';
import instance from '../../api';
import Navbar from "../../Components/Navbar/Navbar";
import "./CardPage.css";
import CardDetails from '../../Components/CardDetails/CardDetails';

const CardPage = () => {
  const [products, setProdcuts] = useState([]);

  useEffect(() => {
    const fetchProducts = async () => {
      try {
        const response = await instance.get('/api/products')
        console.log("allah maao", response.data)
        setProdcuts(response.data)
      } catch (error) {
        console.error('Error fetching subCategories', error.message)
      }
    }
    fetchProducts();
  }, [])


  return (
    <>
    <div className='card-page-wrapper'>
      <Navbar />
      <div className="card-wrapper" id="House" >
        <div className="category-header-in-wrapper">
          <span><h5>House | </h5>Furniture - Appliances - Household</span>
        </div>
        <div className="card-container">
          {products.map((product, _id) => (
            <dis key={product._id} className='card' target='_blank'>
              <div className="card-image-container">
                <img src={`${instance.defaults.baseURL}/${product.image}`} className="card-img-top" alt="" />
              </div>
              <div className="card-body">
                <h5 className="card-title">{product.title}</h5>
                <p className="card-text">{product.description.substring(0, 100)}...</p>
                <a href="#" className="btn btn-primary">More details</a>
              </div>
            </dis>
          ))}
        </div>
      </div>
    </div>

      </>
  );
}

export default CardPage;
